import React from "react";
import { InfoContainer } from "../../componentes/info_destacada/InfoDestafadaElementos";

import ArrowDownwardIcon from "@material-ui/icons/ArrowDownward";

const Inicio = () => {
	return (
		<InfoContainer>
			<InfoItem>
				<InfoTitulo>Receita</InfoTitulo>
				<InfoDinheiroContainer>
					<InfoDinheiro>$2,451</InfoDinheiro>
					<InfoDinheiroPorcentagem>-2.5%</InfoDinheiroPorcentagem>
				</InfoDinheiroContainer>
			</InfoItem>
		</InfoContainer>
	);
};

export default Inicio;
